import React from 'react';
import CourseList from './CourseList';

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            user: '',
            password: '',
            courses: [{
                name: "数学",
                code: "MATH101",
                description: "这是一个基础数学课程。",
            },
            {
                name: "物理",
                code: "PHYS101",
                description: "这是一个基础物理课程。",
            },
            {
                name: "化学",
                code: "CHEM101",
                description: "这是一个基础化学课程。",
            }]
        };
    }

    render() {
        return (
            <div>
                <h1>课程列表</h1>
                <CourseList courses={courses} />
            </div>
        );
    }
}

export default Home;
